import React from "react";
import { List, Datagrid, TextField, Show } from "react-admin";

const OnePrintInventoryList = (props) => {
  return (
    <Show {...props}>
      <TabbedShowLayout>
        <Tab label="Books">
          <ArrayField source="books" label="">
            <Datagrid>
              <TextField source="name" />
            </Datagrid>
          </ArrayField>
        </Tab>
      </TabbedShowLayout>
    </Show>
    // <List {...props}>
